import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Users from "./user/pages/Users";

const App = () => {
  return (
    <Router>
      <Route path="/" exact>
        {" "}
        {/*path / will take all routes starting with /, so we add the exact property*/}
        <Users />
      </Route>
    </Router>
  );
};

export default App;
